" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Mammary duct fistula",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 245px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A mammary duct fistula is a communication between a subareolar duct and the skin, usually in the periareolar area. This patient has bilateral fistulae.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael J Dixon, MD.",
"    </div>",
